import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import { Router } from 'react-router-dom';

ReactDOM.render(
  
  <React.StrictMode>
    <App />
  </React.StrictMode>,
    <Router>
    <div className="App">
        <Navigation />
        <Routes />
    </div>
  </Router>,
  document.getElementById('root')
);
